import { View, Image, StyleSheet, TouchableOpacity, Text } from "react-native";
import React from "react";
import { useNavigation } from "@react-navigation/native";

export default function CatAccessoriesPics() {
  const navigation = useNavigation();
  return (
    <View>
      <TouchableOpacity
        style={styles.card}
        onPress={() => navigation.navigate("DetailScreen")}
      >
        <View style={styles.cardView}>
          <Image
            style={styles.cardImage}
            source={require("../../assets/CatAccessories/CatAccessory1.jpg")}
          />
          <Text style={styles.nameStyling}>Cat Nail Cutter</Text>
          <Text style={styles.locationStyling}>Rawalpindi</Text>
          <Text style={styles.priceStyling}>Rs.4000/-</Text>
        </View>
      </TouchableOpacity>

      <TouchableOpacity style={styles.card}>
        <View style={styles.cardView}>
          <Image
            style={styles.cardImage}
            source={require("../../assets/CatAccessories/CatAccessory2.jpg")}
          />
          <Text style={styles.nameStyling}>Bell Bow Tie</Text>
          <Text style={styles.LoctStyling}>Rawalpindi</Text>
          <Text style={styles.priceStyling}>Rs.4000/-</Text>
        </View>
      </TouchableOpacity>
      <TouchableOpacity style={styles.card}>
        <View style={styles.cardView}>
          <Image
            style={styles.cardImage}
            source={require("../../assets/CatAccessories/CatAccessory3.jpg")}
          />
          <Text style={styles.nameStyling}>Hair Remover </Text>
          <Text style={styles.locationStyling}>Rawalpindi</Text>
          <Text style={styles.priceStyling}>Rs.4000/-</Text>
        </View>
      </TouchableOpacity>
      <TouchableOpacity style={styles.card}>
        <View style={styles.cardView}>
          <Image
            style={styles.cardImage}
            source={require("../../assets/CatAccessories/CatAccessory4.jpg")}
          />
          <Text style={styles.nameStyling}>Self Cleaner</Text>
          <Text style={styles.LoctStyling}>Rawalpindi</Text>
          <Text style={styles.priceStyling}>Rs.4000/-</Text>
        </View>
      </TouchableOpacity>
      <TouchableOpacity style={styles.card}>
        <View style={styles.cardView}>
          <Image
            style={styles.cardImage}
            source={require("../../assets/CatAccessories/CatAccessory5.jpeg")}
          />
          <Text style={styles.nameStyling}>Cat House</Text>
          <Text style={styles.CatHouse}>Rawalpindi</Text>
          <Text style={styles.priceStyling}>Rs.4000/-</Text>
        </View>
      </TouchableOpacity>
    </View>
  );
}

var styles = StyleSheet.create({
  ImageStyling: {
    height: 100,
    width: 100,
    //margin:-10
    // marginLeft:-10,
    //marginRight:-10,
    resizeMode: "cover",
  },
  card: {
    backgroundColor: "#fff",
    marginBottom: 10,
    marginLeft: "2%",
    width: "100%",
    shadowColor: "#000",
    /* shadowOpacity:1,
    shadowOffset:{
        height:3,
        width:3
    }*/
  },
  cardImage: {
    width: "50%",
    height: 120,
    resizeMode: "contain",
    borderRadius: 10,
  },
  nameStyling: {
    marginLeft: 3,
    marginTop: 10,
    fontWeight: "bold",
    fontSize: 25,
  },
  locationStyling: {
    marginLeft: -110,
    marginTop: 50,
    fontWeight: "bold",
    fontSize: 20,
  },
  priceStyling: {
    marginLeft: -80,
    marginTop: 80,
    fontWeight: "bold",
    fontSize: 20,
  },
  cardView: {
    flexDirection: "row",
  },
  LoctStyling: {
    marginLeft: -90,
    marginTop: 50,
    fontWeight: "bold",
    fontSize: 20,
  },
  CatHouse: {
    marginLeft: -70,
    marginTop: 50,
    fontWeight: "bold",
    fontSize: 20,
  },
});
